const initialSizes = [
  { name: "S", quantity: 0 },
  { name: "M", quantity: 0 },
  { name: "L", quantity: 0 },
  { name: "X", quantity: 0 },
  { name: "XL", quantity: 0 },
  { name: "2XL", quantity: 0 },
  { name: "3XL", quantity: 0 },
];
const CreateProductForm = () => {
  const [productData, setProductData] = useState({
    imageUrl: "",
    brand: "",
    title: "",
    color: "",
    discountPrice: "",
    price: "",
    disountPercent: "",
    size: initialSizes,
    quantity: "",
    topLevelCategory: "",
    seceondLevelCategory: "",
    thirdLevelCategory: "",
    description: "",
  });
  
  return <div></div>;
};

export default CreateProductForm;
